import React from 'react';

function MyInput() {
  const handleInputChange = (event) => {
    console.log('Anda mengetik: ' + event.target.value);
  };

  return (
    <input type="text" onChange={handleInputChange} placeholder="Ketik sesuatu..." />
  );
}

export default MyInput;
